import React from 'react';
import './App.css';

import Header from './Header';
import Main from './Main';
import Main2 from './Main2';
import {
  BrowserRouter,
  Routes, // instead of "Switch"
  Route,
} from "react-router-dom";



function App() {
  return (
   <div>

    <Brower Router>
      <Router>
      <Route exact path="/" element={<Main />}>
      <Main/>
      </Route>
      </Router>
    </Brower>
    </div>
  );
}

export default App;
